INSERT INTO `quiz` VALUES (1,'8','Find out Jerry\'s age. (e.g. 10)',1,'Jerry의 나이를 알아보세요. (예시. 10)'),(2,'retriever','Find out which dog breed Jerry wants to raise. (e.g. maltese)',1,'Jerry가 키우고 싶어하는 강아지 품종에 대해 알아보세요. (예시. maltese)'),(3,'7:00am','Sanha is running. Find out what time you started running. (e.g. 7:30am) ',1,'Sanha가 달리기를 하고 있네요. 몇시부터 했는지 알아보세요. (예시. 7:30am) '),(4,'3','Ask Marco about the winning team\'s score in the \'LingoTown\' youth soccer tournament. (e.g. 2) ',1,'Marco가 ‘LingoTown’ 청소년 축구 대회에서 몇 대 몇으로 우승했는지 알아보세요. (예시. 2)'),(5,'7:00p.m','Ask Marco what time the winner’s celebration party starts. (e.g. 5:45pm)',1,'Marco가 가는 우승축하파티가 몇시에 시작하는지 알아보세요. (예시. 5:45pm)'),(6,'Polo','Find out the name of Marco\'s girlfriend. (e.g. Marco)',1,'Marco의 여자친구의 이름을 알아보세요. (예시. Marco)'),(7,'pizza','Bonnie is here. Ask about Bonnie\'s favorite food. (e.g. sandwich)',1,'Bonnie가 좋아하는 음식이 무엇인지 알아보세요. (예시. cake)'),(8,'Yes','Bonnie is here.  Ask if she has partner for the graduation prom. (e.g. Yes or No)',1,'Bonnie가 졸업 파티 파트너를 구했는지 알아보세요. (예시. Yes / No)'),(9,'8','Découvrez l\'âge de Jerry. (p. ex. 10)',5,'Jerry의 나이를 알아보세요. (예시. 10)'),(10,'retriever','Demandez-vous sur la race de chien que Jerry veut avoir. (p. ex. maltais)',5,'Jerry가 키우고 싶어하는 강아지 품종에 대해 알아보세요. (예시. maltese)'),(11,'7:00am','Sanha court dans le parc. Trouve à quelle heure elle a commencé à courir. (p. ex. 7:30am)',5,'Sanha가 달리기를 하고 있네요. 몇시부터 했는지 알아보세요. (예시. 7:30am) '),(12,'3','Demandez-vous sur l\'équipe gagnante et sur le score à Marco (p. ex. 2)',5,'Marco가 ‘LingoTown’ 청소년 축구 대회에서 몇 대 몇으로 우승했는지 알아보세요. (예시. 2)'),(13,'7:00p.m','Demandez à Marco à quelle heure commence la fête du gagnant. (p. ex. 5:45pm)',5,'Marco가 가는 우승축하파티가 몇시에 시작하는지 알아보세요. (예시. 5:45pm)'),(14,'Polo','Trouve le nom de la petite amie de Marco, et de quel pays elle vient. (p. ex. Marco)',5,'Marco의 여자친구의 이름을 알아보세요. (예시. Marco)'),(15,'pizza','Votre ami Bonnie et là! Découvrez quel est son plat préféré.',5,'Bonnie가 좋아하는 음식이 무엇인지 알아보세요. (예시. cake)'),(16,'Oui','Votre ami et là! Demandez s\'il a un partenaire pour le bal de fin d\'études. (p. ex. Oui/Non)',5,'Bonnie가 졸업 파티 파트너를 구했는지 알아보세요. (예시. Yes / No)'),(18,'Yes','It\'s Raining. Ask Jaden if he can borrow an umbrella (e.g. Yes / No)',2,'비가 오네요. Jaden에게 우산을 빌릴 수 있는지 물어보세요. (예시. Yes / No)'),(19,'French','Find out which languages Daen can handle except English. (e.g. Engilsh)',2,'Daen이 영어를 제외하고 다룰 수 있는 언어가 무엇인지 알아보세요. (예시. English)'),(20,'3','Ask Kevin how many teams there will be in total for today\'s presentation (e.g. 5)',2,'오늘 발표는 총 몇 팀으로 진행되는지 Kevin에게 물어보세요. (예시. 5)'),(21,'Jaden','Find out what Kevin\'s twin brother\'s name is. (e.g. Marco)',2,'Kevin의 쌍둥이 형제의 이름이 무엇인지 알아보세요. (예시. Marco)'),(22,'5','Demandez à Jaden à quel étage vous pouvez récupérer votre carte d\'identité d\'employé. (p. ex. 9)',6,'사원증을 받기 위해 몇 층으로 가야 하는지 Jayden에게 물어보세요. (예시. 9)'),(23,'Oui','Il pleut! Demandez à votre collègue Jaden s’il a apporté un parapluie. (p. ex. Oui/Non)',6,'비가 오네요. Jaden에게 우산을 빌릴 수 있는지 물어보세요. (예시. Yes / No)'),(24,'Français ','Découvrez quelles langues Daen peut parler sauf l\'anglais (p. ex. Anglais)',6,'Daen이 영어를 제외하고 다룰 수 있는 언어가 무엇인지 알아보세요. (예시. English)'),(25,'3','Découvrez combien d\'équipes sont présentées aujourd\'hui. Demandez à Kevin. (p. ex. 5)',6,'오늘 발표는 총 몇 팀으로 진행되는지 Kevin에게 물어보세요. (예시. 5)'),(26,'Jaden','Trouvez le nom du frère jumeau de Kevin. (p. ex. Marco)',6,'Kevin의 쌍둥이 형제의 이름이 무엇인지 알아보세요. (예시. Marco)'),(27,'bibimbap','Get Olivia\'s recommendation for today\'s menu. (e.g. pizza)',3,'Olivia에게 오늘의 음식을 추천 받아보세요. (예시. pizza)'),(28,'10%','Ask Olivia how much discount you can get if you write a review. (e.g. 30%)',3,'리뷰 할인을 진행합니다. Olivia에게 몇 퍼센트 할인받을 수 있는지 물어보세요. (예시. 30%)'),(29,'2','Ask Olivia about the level of spiciness of ‘bibimbap’ (e.g. 3)',3,'비빔밥을 파네요. Olivia를 통해 매운 단계를 알아보세요. (예시. 3)'),(30,'40min','There are a lot of customers. Ask Olivia how long she has to wait. (e.g. 30min)',3,'손님이 많네요. 올리비아에게 얼마나 기다려야 하는지 물어보세요. (예시. 30min)'),(31,'bibimbap','Obtenez les recommandations alimentaires d\'aujourd\'hui! Demandez à Olivia le chef. (p.ex. salade).',7,'Olivia에게 오늘의 음식을 추천 받아보세요. (예시. pizza)'),(32,'Oui','Demandez à Olivia le chef combien de rabais vous pouvez obtenir! (p. ex. 30%)',7,'리뷰 할인을 진행합니다. Olivia에게 몇 퍼센트 할인받을 수 있는지 물어보세요. (예시. 30%)'),(33,'2','Découvrez le niveau d\'épice du ‘bibimbap’. Demandez à Olivia (p. ex. 3)',7,'비빔밥을 파네요. Olivia를 통해 매운 단계를 알아보세요. (예시. 3)'),(34,'40min','Demande à Olivia combien de temps tu devrais attendre. (p.ex. 30 min)',7,'손님이 많네요. 올리비아에게 얼마나 기다려야 하는지 물어보세요. (예시. 30min)'),(36,'harmonica','Find out which musical instrument Isabel is currently learning. (e.g. piano)',3,'Isabel이 현재 배우는 악기가 무엇인지 알아보세요. (예시. piano)'),(37,'Korea','Find out which country Luke wants to visit the most. (e.g. Canada)',3,'Luke가 가장 가고 싶은 여행지가 어디인지 알아보세요. (예시. Canada)'),(38,'Tuesday','Your friend Jina is here. Find out what day you have to submit your art homework. (e.g. Monday)',4,'친구 Jina가 있네요. 미술 숙제를 몇 요일 해야 하는지 알아보세요. (예시. Monday)'),(39,'LingoTango','Find out the name of the store where Jina works part-time. (e.g. LingoMongo)',4,'친구 Jina가 아르바이트하는 가게 이름을 알아보세요. (예시. LingoMongo)'),(40,'Oriental Art','Ask Jina what major she wants to study. (e.g. Computer Science)',4,'친구 Jina가 전공하고 싶은 학과에 대해 알아보세요. (예시. Computer Science)'),(41,'4','Find out how many friends Barry came here with (e.g. 5)',4,'Barry가 몇 명의 친구와 함께 이 곳을 왔는지 알아보세요. (예시. 5)'),(42,'10','Find out how many days Barry is going to stay here. (e.g. 7)',4,'Barry가 이 곳에서 며칠 머무를 예정인지 알아보세요. (예시. 3)'),(43,'Ojoshi History','Find out the name of the exhibition that Sheriff Jimmy works for (e.g. LingoMongo)',4,'Jimmy가 일을 하는 전시회 이름이 무엇인지 알아보세요. (예시. LingoMongo)'),(44,'05/13','There\'s a tourist, Barry. Find out his birthday. (e.g. 12/09)',4,'관광객 barry이 보이네요. 생일을 알아보세요. (예시. 12/09)'),(45,'harmonica','Découvrez quel instrument de musique Isabel apprend actuellement. (p. ex. piano)',7,'Isabel이 현재 배우는 악기가 무엇인지 알아보세요. (예시. piano)'),(46,'Korea','Find out which country Luke wants to visit the most. (e.g. Canada)',7,'Luke가 가장 가고 싶은 여행지가 어디인지 알아보세요. (예시. Canada)'),(47,'Mardi','Votre amie Jina est là. Découvrez quel jour vous devez soumettre vos devoirs d\'art. (p. ex. Lundi)',8,'친구 Jina가 있네요. 미술 숙제를 몇 요일 해야 하는지 알아보세요. (예시. Lundi)'),(48,'LingoTango','Trouvez le nom du magasin où Jina travaille à temps partiel. (p. ex. Lingo Mongo)',8,'친구 Jina가 아르바이트하는 가게 이름을 알아보세요. (예시. Lingo Mongo)'),(49,'Art Oriental','Demande à Jina quel major elle veut étudier. (p. ex. Informatique)',8,'친구 Jina가 전공하고 싶은 학과에 대해 알아보세요. (예시.Informatique)'),(50,'4','Renseignez-vous sur le nombre d\'amis avec qui Barry est venu ici (p. ex. 5)',8,'Barry가 몇 명의 친구와 함께 이 곳을 왔는지 알아보세요. (예시. 5)'),(51,'10','Découvrez combien de jours Barry va rester ici (p. ex. 7)',8,'Barry가 이 곳에서 며칠 머무를 예정인지 알아보세요. (예시. 3)'),(52,'Histoire d\'Ojoshi','Renseignez-vous sur le nom de l\'exposition pour laquelle travaille le shérif Jimmy (p. ex. Lingo Mongo)',8,'Jimmy가 일을 하는 전시회 이름이 무엇인지 알아보세요. (예시. LingoMongo)'),(53,'05/13','Il y a un touriste, Barry. Trouve son anniversaire. (p. ex. 12/09)',8,'관광객 barry이 보이네요. 생일을 알아보세요. (예시. 12/09)'),(54,'5','Ask Jaden which floor to go to get your employee ID. (e.g 9)',2,'사원증을 받기 위해 몇 층으로 가야 하는지 Jaden에게 물어보세요. (예시. 9)');
