INSERT INTO `talk_detail` VALUES (1,'2023-11-06 08:05:35','2023-11-06 08:05:39','\"Hi how are you?\"',NULL,'주어가 없는 문장입니다. \"Hi\"는 인사말이므로 주어가 필요합니다. 따라서, \"Hi, how are you?\"로 수정해야 합니다.',_binary '','https://b305finalproject.s3.ap-northeast-2.amazonaws.com/Record/bbe5eeb6-7408-4e2e-828f-35e859dae28b_howareyou.m4a',7),(2,'2023-11-06 08:05:36','2023-11-06 08:05:36','Hi! I\'m doing great, thank you! How about you?',NULL,NULL,_binary '\0','https://b305finalproject.s3.ap-northeast-2.amazonaws.com/Record/93cca806-ff16-4193-a868-53fe08bb5f0a_output.mp3',7),(3,'2023-11-06 08:06:02','2023-11-06 08:06:04','\"i\'m fine thank you!\"',NULL,'이 문장에는 문법적 오류가 없습니다.',_binary '','https://b305finalproject.s3.ap-northeast-2.amazonaws.com/Record/f7277d0d-436e-47f3-b2d2-714b98f46b6c_howareyou.m4a',7),(4,'2023-11-06 08:06:03','2023-11-06 08:06:03','That\'s wonderful to hear! So, what brings you to the park today?',NULL,NULL,_binary '\0','https://b305finalproject.s3.ap-northeast-2.amazonaws.com/Record/6e4c86d9-3436-42a4-a16b-d4c7ba39b76f_output.mp3',7),(5,'2023-11-06 08:07:05','2023-11-06 08:07:08','\"nice to meet you\"',NULL,'이 문장에는 문법적 오류가 없습니다.',_binary '','https://b305finalproject.s3.ap-northeast-2.amazonaws.com/Record/2378054b-e63f-4fdc-8855-aa660ce1b54c_nicetomeetyou.m4a',8),(6,'2023-11-06 08:07:06','2023-11-06 08:07:06','Nice to meet you too, Dayoungi! How can I assist you today?',NULL,NULL,_binary '\0','https://b305finalproject.s3.ap-northeast-2.amazonaws.com/Record/01a9e3ec-77e6-486f-9c81-10dc282ac4a0_output.mp3',8),(7,'2023-11-06 08:07:42','2023-11-06 08:07:45','\"i\'m fine! recommend menu please\"',NULL,'주어와 동사 사이에 쉼표(,)가 빠져 있습니다. 올바른 문장은 \"I\'m fine, recommend menu please\"입니다.',_binary '','https://b305finalproject.s3.ap-northeast-2.amazonaws.com/Record/e245a806-67ec-435f-ad2e-2807cc205f89_nicetomeetyou.m4a',8),(8,'2023-11-06 08:07:42','2023-11-06 08:07:42','I\'m glad to hear that you\'re doing fine, Dayoungi! As the chef of Lingo Mongo, I highly recommend trying our signature